import './App.css';
import axios from 'axios'
import { LineChart, Line, CartesianGrid, XAxis, YAxis } from 'recharts';

function App() {

  function getData(){
    axios.get("http://data.fixer.io/api/latest?access_key=2fe0ad1d7c24d0016498ef8ec7b86137&base=USD")
    .then(res => {
      console.log(res);
    })
  }

  const data = [{name: 'Page A', uv: 400, pv: 2400, amt: 2400},{name: 'Page B', uv: 200, pv: 2400, amt: 2400},{name: 'Page C', uv: 300, pv: 2400, amt: 2400},{name: 'Page D', uv: 230, pv: 2400, amt: 2400},{name: 'Page E', uv: 404, pv: 2400, amt: 2400}];

  return (
    <div className="App">
      <header className="App-header">
      <LineChart width={600} height={300} data={data}>
        <Line type="monotone" dataKey="uv" stroke="#8884d8" />
        <CartesianGrid stroke="#ccc" />
        <XAxis dataKey="name" />
        <YAxis />
      </LineChart>
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <button onClick={getData}>Aobtener datos</button>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
